import { Card } from "./ui/card";
import { useState } from "react";
import { Button } from "./ui/button";
import { CheckCircle, Circle } from "lucide-react";
export function AnalyticsTab() {
  const [selectedTopic, setSelectedTopic] = useState('Testicular Lump')

  const dataSet = [
    {
      id: "1",
      name: "Testicular Lump",
      category: "Outpatient Stations",
      completed: true,
      grade: "Pass",
      strengths: [
        "Demonstrated genuine passion for medicine with specific examples",
        "Connected personal experiences to career motivation effectively",
        "Articulated clear understanding of the medical profession",
      ],
      improvements: [
        "Could provide more details about long-term career goals",
        "Consider adding more recent clinical experiences",
        "Elaborate on how specific challenges shaped your decision",
      ],
    },

    {
      id: "2",
      name: "Raised PSA",
      category: "Outpatient Stations",
      completed: false,
      grade: "Pass",
      strengths: [
        "Provided concrete example using STAR method",
        "Demonstrated strong interpersonal skills",
        "Showed ability to handle conflict constructively",
      ],
      improvements: [
        "Could discuss specific role in the team more clearly",
        "Add reflection on what you learned from the experience",
      ],
    },

    {
      id: "3",
      name: "Haematuria",
      category: "Outpatient Stations",
      completed: true,
      grade: "Pass",
      strengths: [
        "Identified key ethical principles correctly",
        "Considered multiple perspectives in the scenario",
      ],
      improvements: [
        "Need to reference GMC guidelines more explicitly",
        "Should discuss patient autonomy in greater depth",
        "Consider confidentiality implications more thoroughly",
        "Practice balancing competing ethical principles",
      ],
    },

    {
      id: "4",
      name: "Renal mass",
      category: "Outpatient Stations",
      grade: "Pass",
      completed: true,
      strengths: [
        "Identified key ethical principles correctly",
        "Considered multiple perspectives in the scenario",
      ],
      improvements: [
        "Need to reference GMC guidelines more explicitly",
        "Should discuss patient autonomy in greater depth",
        "Consider confidentiality implications more thoroughly",
        "Practice balancing competing ethical principles",
      ],
    },

    {
      id: "5",
      name: "AUR",
      category: "Emergency Station",
      completed: true,
      grade: "Pass",
      strengths: [
        "Demonstrated genuine passion for medicine with specific examples",
        "Connected personal experiences to career motivation effectively",
        "Articulated clear understanding of the medical profession",
      ],
      improvements: [
        "Could provide more details about long-term career goals",
        "Consider adding more recent clinical experiences",
        "Elaborate on how specific challenges shaped your decision",
      ],
    },

    {
      id: "6",
      name: "Renal Colic",
      category: "Emergency Station",
      completed: true,
      grade: "Pass",
      strengths: [
        "Provided concrete example using STAR method",
        "Demonstrated strong interpersonal skills",
        "Showed ability to handle conflict constructively",
      ],
      improvements: [
        "Could discuss specific role in the team more clearly",
        "Add reflection on what you learned from the experience",
      ],
    },

    {
      id: "7",
      name: "Haematuria",
      category: "Emergency Station",
      completed: true,
      grade: "Pass",
      strengths: [
        "Identified key ethical principles correctly",
        "Considered multiple perspectives in the scenario",
      ],
      improvements: [
        "Need to reference GMC guidelines more explicitly",
        "Should discuss patient autonomy in greater depth",
        "Consider confidentiality implications more thoroughly",
        "Practice balancing competing ethical principles",
      ],
    },
  ];
  console.log(selectedTopic, "selectedTopic");
  const categories = Array.from(new Set(dataSet.map((data) => data.category)));
  return (
    <div className="flex gap-6 h-[calc(100vh-280px)]">
    <div className="w-80 flex-shrink-0"></div>
      <Card className="p-4 h-full overflow-auto">
        <h1>Urology Interview</h1>
        <div className="space-y-6">
          {categories.map((category) => (
            <div classname="gap-3">
              <h2>{category}</h2>
              {dataSet
                .filter((data) => data.category === category)
                .map((dataInd) => (
                  <Button
                    onClick={() => setSelectedTopic(dataInd.name)}
                    // variant={
                    //   selectedTopic === dataInd.name ? "bg-black-400" : "ghost"
                    // }
                    className={`w-full justify-start gap-2 ${
                      selectedTopic === dataInd.name
                        ? "bg-black-400"
                        : dataInd.completed
                        ? "bg-green-100 hover:bg-green-100"
                        : "bg-black-900 hover:bg-gray-200"
                    }`}
                  >
                    {dataInd.completed ? (
                      <CheckCircle className="h-4 w-4 text-green-600" />
                    ) : (
                      <Circle className="h-4 w-4 text-gray-600" />
                    )}
                    {dataInd.name}
                  </Button>
                ))}
            </div>
          ))}
        </div>
        {/* {dataSet.map((data) => (
          <div>
            <h2>{data.station}</h2>
            {data.substations.map((substation) => (
              <Button variant="ghost">{substation}ttt</Button>
            ))}
          </div>
        ))} */}
      </Card>
    </div>
  );
}
